import React from 'react';
import Layout from '../Layout/Layout';

function Home() {
  return (
    <div>
      <Layout>
        <div>
          <img
            className='avatar'
            src={require(`../Assets/Images/bg.jpg`)}
            alt='avatar image'
          />
        </div>
      </Layout>
    </div>
  );
}

export default Home;
